import React from 'react'
import {  MDBContainer } from "mdbreact";
import Catgory from './catgory'

const Footer = () => {
    return (
      <div className="saww">
                <Catgory /> 

          <MDBContainer fluid>
            &copy; {new Date().getFullYear()} Copyright: 2019
          </MDBContainer>
          </div>
        );
    }
export default Footer
